        public static void WebServer()
        {
            using var listener = new HttpListener();
            listener.Prefixes.Add("http://localhost:8001/");

            listener.Start();

            while (_Instance.run_webserver)
            {
                HttpListenerContext context = listener.GetContext();
                HttpListenerRequest req = context.Request;

                Console.WriteLine($"Received request for {req.Url}");

                using HttpListenerResponse resp = context.Response;
                

                if(req.Url.ToString().Contains("/page")){

                        resp.Headers.Set("Content-type", "text/html");
                        string folder = @"plugins\";
                        string fileName = "index.htm";
                        string fullPath = folder + fileName;
                        string data;

                        DateTimeOffset dto = new DateTimeOffset(DateTime.UtcNow);
                        if(_Instance.web_feed_active_tout > dto.ToUnixTimeSeconds()){
                            data = File.ReadAllText(fullPath);
                        }else{
                            data = "<script>setTimeout(() => {document.location.reload();}, 2000);</script>CONNECTING...";
                            SendWebHB();
                        }
        
                        byte[] buffer = Encoding.UTF8.GetBytes(data);
                        resp.ContentLength64 = buffer.Length;

                        using Stream ros = resp.OutputStream;
                        ros.Write(buffer, 0, buffer.Length);

                    }else if(req.Url.ToString().Contains("/gtgt.res")){
                        resp.Headers.Set("Content-type", "text/plain");
                        string folder = @"plugins\";
                        string fileName = "gtgt.res";
                        string fullPath = folder + fileName;
                        string data = File.ReadAllText(fullPath);

                        byte[] buffer = Encoding.UTF8.GetBytes(data);
                        resp.ContentLength64 = buffer.Length;

                        using Stream ros = resp.OutputStream;
                        ros.Write(buffer, 0, buffer.Length);

                    }else if(req.Url.ToString().Contains("/css/entire.css")){
                        resp.Headers.Set("Content-type", "text/css");
                        string folder = @"plugins\";
                        string fileName = "entire.css";
                        string fullPath = folder + fileName;
                        string data = File.ReadAllText(fullPath);

                        byte[] buffer = Encoding.UTF8.GetBytes(data);
                        resp.ContentLength64 = buffer.Length;

                        using Stream ros = resp.OutputStream;
                        ros.Write(buffer, 0, buffer.Length);

                    }else if(req.Url.ToString().Contains("/js/entire.js")){
                        resp.Headers.Set("Content-type", "text/js");
                        string folder = @"plugins\";
                        string fileName = "entire.js";
                        string fullPath = folder + fileName;
                        string data = File.ReadAllText(fullPath);

                        byte[] buffer = Encoding.UTF8.GetBytes(data);
                        resp.ContentLength64 = buffer.Length;

                        using Stream ros = resp.OutputStream;
                        ros.Write(buffer, 0, buffer.Length);

                    }else if(req.Url.ToString().Contains("jquery.mobile-1.4.5.min.css")){
                        resp.Headers.Set("Content-type", "text/css");
                        string folder = @"plugins\";
                        string fileName = "jquery.mobile-1.4.5.min.css";
                        string fullPath = folder + fileName;
                        string data = File.ReadAllText(fullPath);

                        byte[] buffer = Encoding.UTF8.GetBytes(data);
                        resp.ContentLength64 = buffer.Length;

                        using Stream ros = resp.OutputStream;
                        ros.Write(buffer, 0, buffer.Length);

                    }else if(req.Url.ToString().Contains("jquery.min.js")){
                        resp.Headers.Set("Content-type", "text/js");
                        string folder = @"plugins\";
                        string fileName = "jquery.min.js";
                        string fullPath = folder + fileName;
                        string data = File.ReadAllText(fullPath);

                        byte[] buffer = Encoding.UTF8.GetBytes(data);
                        resp.ContentLength64 = buffer.Length;

                        using Stream ros = resp.OutputStream;
                        ros.Write(buffer, 0, buffer.Length);

                    }else if(req.Url.ToString().Contains("jquery.mobile-1.4.5.min.js")){
                        resp.Headers.Set("Content-type", "text/js");
                        string folder = @"plugins\";
                        string fileName = "jquery.mobile-1.4.5.min.js";
                        string fullPath = folder + fileName;
                        string data = File.ReadAllText(fullPath);

                        byte[] buffer = Encoding.UTF8.GetBytes(data);
                        resp.ContentLength64 = buffer.Length;

                        using Stream ros = resp.OutputStream;
                        ros.Write(buffer, 0, buffer.Length);

                    }else if(req.Url.ToString().Contains("fontello.ttf")){
                        resp.Headers.Set("Content-type", "font/ttf");
                        byte[] buffer = File.ReadAllBytes(@"plugins\fontello.ttf");
                        resp.ContentLength64 = buffer.Length;

                        using Stream ros = resp.OutputStream;
                        ros.Write(buffer, 0, buffer.Length);

                    }else if(req.Url.ToString().Contains("fontello.woff")){
                        resp.Headers.Set("Content-type", "font/woff");
                        byte[] buffer = File.ReadAllBytes(@"plugins\fontello.woff");
                        resp.ContentLength64 = buffer.Length;

                        using Stream ros = resp.OutputStream;
                        ros.Write(buffer, 0, buffer.Length);


                    }else if(req.Url.ToString().Contains("c.ex?cmd=")){

                        Console.WriteLine(req.Url.ToString());

                        resp.Headers.Set("Content-type", "text/plain");
                        string data = "ok";
                        byte[] buffer = Encoding.UTF8.GetBytes(data);
                        resp.ContentLength64 = buffer.Length;

                        using Stream ros = resp.OutputStream;
                        ros.Write(buffer, 0, buffer.Length);

                        string cmd = req.Url.ToString();
                        string[] s = cmd.Split('?');
                        s[1] = s[1].Replace("cmd=", "");
                        s[1] = s[1].Replace("&a=", "\n");
                        s[1] = s[1].Replace("&b=", "\n");
                        s[1] = s[1].Replace("&c=", "\n");
                        s[1] = s[1].Replace("&d=", "\n");
                        byte[] fincmd = Encoding.UTF8.GetBytes(s[1]);

                        MAVLink.mavlink_tunnel_t msg = new MAVLink.mavlink_tunnel_t
                        {
                            payload_type = 0xFF84,
                            target_system = 1,
                            target_component = (byte)_Instance.target_mavlink_ID,
                            payload_length = 33,
                            payload = fincmd
                        };

                        var mav = _Instance.Host.comPort.MAVlist.FirstOrDefault(a => a.compid == _Instance.target_mavlink_ID);
                        if (mav != null)mav.parent.generatePacket((int) MAVLink.MAVLINK_MSG_ID.TUNNEL, msg, mav.sysid, mav.compid, true, false);


                    }else if(req.Url.ToString().Contains("r.ex")){
                        resp.Headers.Set("Content-type", "text/plain");

                        byte[] buffer;
                        using var fileStream = new FileStream(@"plugins\ac_strm.dat", FileMode.Open, FileAccess.Read, FileShare.ReadWrite);
                        using var textReader = new StreamReader(fileStream);

                        //string data = File.ReadAllText(@"plugins\ac_strm.dat");
                        buffer = Encoding.UTF8.GetBytes(textReader.ReadToEnd());

                        DateTimeOffset dto = new DateTimeOffset(DateTime.UtcNow);
                        if(_Instance.web_feed_active_tout < dto.ToUnixTimeSeconds()){
                            buffer = Encoding.UTF8.GetBytes("offline");
                        }
                        resp.ContentLength64 = buffer.Length;

                        using Stream ros = resp.OutputStream;
                        ros.Write(buffer, 0, buffer.Length);

                        

                        if(_Instance.web_hb_tout <= dto.ToUnixTimeSeconds()){
                            _Instance.web_hb_tout = dto.ToUnixTimeSeconds()+2;
                            SendWebHB();
                        }


                    }else{
                        string data = "";
                        byte[] buffer = Encoding.UTF8.GetBytes(data);
                        resp.ContentLength64 = buffer.Length;

                        using Stream ros = resp.OutputStream;
                        ros.Write(buffer, 0, buffer.Length);
                    }
            }
        }



        public static void SendWebHB()
        {
            byte[] dta = Encoding.UTF8.GetBytes("hb\n");
            MAVLink.mavlink_tunnel_t msg = new MAVLink.mavlink_tunnel_t
            {
                payload_type = 0xFF84,
                target_system = 1,
                target_component = (byte)_Instance.target_mavlink_ID,
                payload_length = 33,
                payload = dta
            };
            var mav = _Instance.Host.comPort.MAVlist.FirstOrDefault(a => a.compid == _Instance.target_mavlink_ID);
            if (mav != null)mav.parent.generatePacket((int) MAVLink.MAVLINK_MSG_ID.TUNNEL, msg, mav.sysid, mav.compid, true, false);
        }

        public static void WriteSettings()
        {
            string folder = @"plugins\";
            string fileName = "ap_cc.cfg";
            string fullPath = folder + fileName;

            var json = JsonConvert.SerializeObject(new {
               webserver = _Instance.WebServerEnabled,
               phone = _Instance.WebServerEnabled,
            });

            File.WriteAllText(fullPath, json);
        }

