        public static void LoadSettings()
        {

            string folder = @"plugins\";
            string fileName = "ap_cc.cfg";
            string fullPath = folder + fileName;

            if(File.Exists(fullPath)){
                string readText = File.ReadAllText(fullPath);                
                var cfg = JObject.Parse(readText);

                try{
                    if(cfg["webserver"].ToString() == "True"){
                        _Instance.WebServerEnabled = true;
                    }else{
                        _Instance.WebServerEnabled = false;
                    }
                    Console.WriteLine(cfg["webserver"].ToString());
                }catch (Exception ex)
                {

                }
                

                //Console.WriteLine($"Webserver Enabled: {root.webserver}");


            }else{
                WriteSettings();
            }

        }


