        public static byte[] eFWbinar;
        public static int eFWbinar_len = 0;
        public int act_block = 0;
        private int ENT_fw_active = 0;

        private void ENT_FW_start(object sender, EventArgs e){

            if(_Instance.entire_online == false){
                MessageBox.Show("ENTIRE is offline!");
                ENT_fw_active = 0;
                return;
            }

            if(ENT_fw_active == 0){


                using (OpenFileDialog openFileDialog = new OpenFileDialog())
                {
                    // Set the filter to accept only .img files
                    openFileDialog.Filter = "IMG files (*.img)|*.img";
                    openFileDialog.Title = "Select an update pack";

                    // Show the dialog and get the selected file
                    if (openFileDialog.ShowDialog() == DialogResult.OK)
                    {
                        try
                        {
                            eFWbinar = File.ReadAllBytes(openFileDialog.FileName);
                            eFWbinar_len = eFWbinar.Length;
                            //MessageBox.Show("FW loaded successfully!");
                        }
                        catch (Exception ex)
                        {
                            MessageBox.Show("Error loading FW file: " + ex.Message);
                            return;
                        }
                    }else{
                        ENT_fw_active = 0;
                        update_label.Text = "ENTIRE fw update";
                        StopFwUpdate();
                        return;
                    }
                }

                gen_command("mav_fw_1");

                update_label.Text = "STOP update!";
                ENT_fw_active = 1;
            }else{

                update_label.Text = "ENTIRE fw update";
                ENT_fw_active = 0;
                StopFwUpdate();
            }


        }


        private void gen_command(string cmd){


            byte[] fincmd = Encoding.UTF8.GetBytes(cmd);

            MAVLink.mavlink_tunnel_t msg = new MAVLink.mavlink_tunnel_t
            {
                payload_type = 0xFF84,
                target_system = 1,
                target_component = (byte)_Instance.target_mavlink_ID,
                payload_length = 33,
                payload = fincmd
            };

            var mav = _Instance.Host.comPort.MAVlist.FirstOrDefault(a => a.compid == _Instance.target_mavlink_ID);
            if (mav != null)mav.parent.generatePacket((int) MAVLink.MAVLINK_MSG_ID.TUNNEL, msg, mav.sysid, mav.compid, true, false);

        }


        private static byte ENT_FW_block_size = 248;

        private void ENT_FW_send_block(int block){

            var mav = _Instance.Host.comPort.MAVlist.FirstOrDefault(a => a.compid == _Instance.target_mavlink_ID);
            if (mav == null){
                Console.WriteLine("ErrorSendMavlink");
            }

            byte datalen = ENT_FW_block_size;
            long start = ENT_FW_block_size * block;

            byte[] data = new byte[ENT_FW_block_size+5];

            if(start + ENT_FW_block_size > eFWbinar.Length){
                //we are at the end
                datalen = (byte)(eFWbinar.Length - start);
            }

            Array.Copy(eFWbinar, start, data, 4, datalen);

            byte sum = 0;
            for(int i=0; i<datalen; i++)sum += data[i+4];
            data[datalen+4] = sum;

            Console.WriteLine("block"+block);

            data[0] = datalen;

            data[1] = (byte)((block>>16) & 0xff);
            data[2] = (byte)((block>>8) & 0xff);
            data[3] = (byte)(block & 0xff);


            MAVLink.mavlink_file_transfer_protocol_t msg = new MAVLink.mavlink_file_transfer_protocol_t
            {
                target_network = 0xF1,
                target_system = 1,
                target_component = (byte)_Instance.target_mavlink_ID,
                payload = data
            };



            //mav.parent.generatePacket((int) MAVLink.MAVLINK_MSG_ID.FILE_TRANSFER_PROTOCOL, msg, mav.sysid, mav.compid, true, false);
//----------------------------------
            MAVLink.mavlink_encapsulated_data_t msgg = new MAVLink.mavlink_encapsulated_data_t
            {
                seqnr = 0xFEF1,
                data = data
            };
            mav.parent.generatePacket((int) MAVLink.MAVLINK_MSG_ID.ENCAPSULATED_DATA, msgg, mav.sysid, mav.compid, true, false);

        }

        private static void Up_Timeout(Object source, ElapsedEventArgs e)
        {
            _Instance.ENT_FW_send_block(_Instance.act_block);
            _Instance.act_block++;

            _Instance.ENT_FW_send_block(_Instance.act_block);
            _Instance.act_block++;

        }
        private static void BlockLoopy(Object source, ElapsedEventArgs e)
        {
            if(_Instance.ShowFwUpdateQuestion){
                _Instance.StartFWupdateQuestion();
            }
        }


        private static void Loopy(Object source, ElapsedEventArgs e)
        {

            //Console.WriteLine("loopy");

/*
            if(_Instance.reload_tab>0){
                if(_Instance.reload_tab == 1){
                    Console.WriteLine("Adding TAB!");
                    _Instance.reload_tab = 0;
                    _Instance.tabctrl.TabPages.Add(_Instance.tab);
                    //_Instance.Host.MainForm.FlightPlanner.updateDisplayView();
                    ThemeManager.ApplyThemeTo(_Instance.tab);

                    //_Instance.Host.MainForm.FlightPlanner.updateDisplayView();
                    //_Instance.Reposition();
                    //_Instance.ApplyDefaultStyle();
                }else{
                    Console.WriteLine("Decreasing tabcnts TAB!");
                    _Instance.reload_tab--;
                }

            }
*/

            _Instance.Reposition();

            if(_Instance.EntireTimeout > 0){
                int now = (int)(DateTime.UtcNow.Subtract(new DateTime(1970, 1, 1))).TotalSeconds;
                if(now > _Instance.EntireTimeout){
                    _Instance.EntireStatus(false);
                    _Instance.ExpanderStatus(false);
                    _Instance.TageStatus(false);
                }
            }

            if(_Instance.entire_online){
                _Instance.show_ALL();
            }
            if(_Instance.expander_online){
                _Instance.show_LR1_UI();
            }
            if(_Instance.tage_online){
                _Instance.show_TAGE();
            }
            if(_Instance.initreposition > 0){
                _Instance.initreposition--;
                _Instance.forcerepos = true;
                _Instance.Reposition();
            }

            if(_Instance.ENT_fw_active == 1){
                float perc = ((float)_Instance.act_block*100) / ((float)eFWbinar.Length/(float)ENT_FW_block_size);
                if(perc > 98){
                        _Instance.update_prgrs_label.Text = "Decompressing...";
                    }else{
                        _Instance.update_prgrs_label.Text = " "+perc.ToString("0.0")+"%";
                    }
                
                //_Instance.Host.MainForm.FlightPlanner.updateDisplayView();
            }


        }

