            b.FlatAppearance.BorderSize = 0;
            b.FlatAppearance.MouseOverBackColor = System.Drawing.Color.Transparent;
            b.FlatAppearance.MouseDownBackColor = System.Drawing.SystemColors.ControlDark;
            b.FlatStyle = System.Windows.Forms.FlatStyle.Flat;
            b.BackColor = System.Drawing.Color.Transparent;
            b.ForeColor = System.Drawing.Color.FromArgb(((int)(((byte)(95)))), ((int)(((byte)(134)))), ((int)(((byte)(142)))));
            b.TextAlign = System.Drawing.ContentAlignment.MiddleCenter;
            var fontsize = (float)b.Width/14;
            b.Font = new System.Drawing.Font("Microsoft Sans Serif", fontsize, System.Drawing.FontStyle.Bold, System.Drawing.GraphicsUnit.Point, ((byte)(0)));
            b.UseVisualStyleBackColor = false;
        }

