        private void StartFWupdateQuestion(){
                if(ShowFwUpdateQuestionactive)return;
                ShowFwUpdateQuestionactive = true;
                ShowFwUpdateQuestion = false;
                update_prgrs_label.Text = "Update ready!";
                MessageBox.Show("FW uploaded\nStart firmware update?");
                DialogResult dialogResult = MessageBox.Show("Do not power toggle the ENTIRE for next 3 minutes! Start update?", "File upload OK", MessageBoxButtons.YesNo);
                
                if(dialogResult == DialogResult.Yes){
                    gen_command("fw_update");
                    gen_command("fw_update");
                    StopFwUpdate();
                    update_prgrs_label.Text = "Update started!";
                    Host.MainForm.FlightPlanner.updateDisplayView();
                }
                update_prgrs_label.Text = "";
                ShowFwUpdateQuestionactive = false;
                ShowFwUpdateQuestion = false;
                StopFwUpdate();
        }

        private bool parseSTMsg(MAVLink.MAVLinkMessage msg) {



            var st = (MAVLink.mavlink_statustext_t)msg.data;
            Console.WriteLine("------------------------------------ Status Text! "+st.text);

            return true;
        }


        private bool parseTunnelMsg(MAVLink.MAVLinkMessage msg) {



            var tnl = (MAVLink.mavlink_tunnel_t)msg.data;
            if(tnl.payload_type == 0xFF85){
                parseWebFeed(msg);

            }else if(tnl.payload_type == 0xFF86){
                parseGtgtRes(msg);

            }else if(tnl.payload_type == 0xFEF1){ //update related data
                Console.WriteLine("Tunnel! "+tnl.payload[0]+" - "+tnl.payload[1]);
                if(tnl.payload[0] == 0x95){
                    if(ENT_fw_active == 0)return true;
                    //block request
                    int block = (tnl.payload[1]<<16) | (tnl.payload[2]<<8) | tnl.payload[3];
                    Console.WriteLine("BLOCK request: "+block);
                    updt_tmr.Enabled = false;
                    act_block = block;
                    ENT_FW_send_block(act_block);
                    updt_tmr.Enabled = true;

                }else if(tnl.payload[0] == 0x96){ //feedback message

                    if(tnl.payload[1] == 0xF0){ //file write error
                        update_prgrs_label.Text = "Error";
                        updt_tmr.Enabled = false;
                        ShowFwUpdateQuestion = false;
                        update_prgrs_label.Text = "File error!";
                        _Instance.ENT_fw_active = 0;
                        StopFwUpdate();

                    }else if(tnl.payload[1] == 0xA1){//file write done
                        if(ENT_fw_active == 0)return true;
                        updt_tmr.Enabled = false;
                        ShowFwUpdateQuestion = true;

                    }else if(tnl.payload[1] == 0xFB){//file decompression error
                        if(ENT_fw_active == 0)return true;
                        updt_tmr.Enabled = false;
                        ShowFwUpdateQuestion = false;
                        update_prgrs_label.Text = "File error!";
                        _Instance.ENT_fw_active = 0;
                        StopFwUpdate();

                    }
                }
                
            }

            
            return true;
        }


        private bool parseGtgtRes(MAVLink.MAVLinkMessage msg) {

            var tnl = (MAVLink.mavlink_tunnel_t)msg.data;

            Console.WriteLine("GtgtRes! " + tnl.payload[0]);


            if(tnl.payload[0] == 0)gtgtResCntr = 0;

            for(int i=1; i<=tnl.payload_length; i++){
                gtgtRes[gtgtResCntr++] = tnl.payload[i];
                if(gtgtResCntr > 6000)gtgtResCntr=6000;
            }

            if((tnl.payload[0] & 0x80)>0){
                //last message
                //Console.WriteLine("Last WebFeed!");
                string folder = @"plugins\";
                string fileName = "gtgt.res";
                string fullPath = folder + fileName;
                string utfString = Encoding.UTF8.GetString(gtgtRes, 0, gtgtResCntr);

                File.WriteAllText(fullPath, utfString);
            }
            return true;
        }



        private bool parseWebFeed(MAVLink.MAVLinkMessage msg) {

            var tnl = (MAVLink.mavlink_tunnel_t)msg.data;

            //Console.WriteLine("WebFeed! " + tnl.payload[0]);


            if(tnl.payload[0] == 0)webFeedCntr = 0;

            for(int i=1; i<=tnl.payload_length; i++){
                webFeed[webFeedCntr++] = tnl.payload[i];
                if(webFeedCntr > 3100)webFeedCntr=3100;
            }

            if((tnl.payload[0] & 0x80)>0){
                //last message
                //Console.WriteLine("Last WebFeed!");
                string folder = @"plugins\";
                string fileName = "ac_strm.dat";
                string fullPath = folder + fileName;
                string utfString = Encoding.UTF8.GetString(webFeed, 0, webFeedCntr);

                File.WriteAllText(fullPath, utfString);

                DateTimeOffset dto = new DateTimeOffset(DateTime.UtcNow);
                _Instance.web_feed_active_tout = dto.ToUnixTimeSeconds()+3;

            }
            return true;
        }

