        private static Image Base64ToImage(string base64String)

        {
            byte[] imageBytes = Convert.FromBase64String(base64String);
            MemoryStream ms = new MemoryStream(imageBytes, 0, imageBytes.Length);
            ms.Write(imageBytes, 0, imageBytes.Length);
            Image image = Image.FromStream(ms, true);
            return image;
        }



        int logging_status = 0;
        int sensed_photos = 0;
        int gtg_progress = 0;
        int lw_distance = 0;

        
        private bool parseGTGStatusDta16(MAVLink.MAVLinkMessage msg) {


            byte cntr=12;
            if(msg.buffer[cntr++] != 0xAC)return false;
            if(msg.buffer[cntr++] != 0xA9)return false;


            logging_status = (int) msg.buffer[14] & 0xff;
            gtg_progress = (int) msg.buffer[15] & 0xff;
            sensed_photos = (msg.buffer[16]& 0xff);
            sensed_photos |= (msg.buffer[17] & 0xff) << 8;

            lw_distance = (msg.buffer[18] & 0xff);
            lw_distance |= (msg.buffer[19] & 0xff) << 8;

            int CAM_ready=0;
            if(tage_online){
                CAM_ready = (msg.buffer[20] & 0xff);

                switch(logging_status){
                    case 0:
                        //printf("GeoTagging IDLE\n");
                        lbl_gtgsts_btm.Text = "READY ("+ sensed_photos+")";
                    break;
                    case 1:
                        //printf("Session Initialization\n");
                        //lbl_gtgsts_btm.Text = "INITIALIZATION";
                    break;
                    case 2:
                        //printf("Session Running\n");
                        lbl_gtgsts_btm.Text = "RUN (" + sensed_photos+")";
                    break;
                    case 3:
                        //printf("Session Saving data\n");
                        lbl_gtgsts_btm.Text = "WRITE (" + gtg_progress + "%)";
                    break;
                    case 100:
                        //printf("Session Error\n");
                        lbl_gtgsts_btm.Text = "ERROR!";
                    break;
                }

                if((CAM_ready == 0) & (logging_status == 0)){
                        lbl_cam_btm.Text = "DISCONNECTED";
                        lbl_gtgsts_btm.Text = "N/A";

                }else if((CAM_ready == 0) & (logging_status == 3)){
                        lbl_cam_btm.Text = "GEOTAGGING";

                }else if((CAM_ready == 1)){
                        lbl_cam_btm.Text = "READY";

                }else{
                    lbl_cam_btm.Text = "DISCONNECTED";
                    lbl_gtgsts_btm.Text = "N/A";
                }
                
            }

            Console.WriteLine("Data16! "+sensed_photos+" - "+logging_status);



            return true;
        }


        private int mav_decode_entire_status( MAVLink.MAVLinkMessage msg)
        {

            byte cntr=12;
            bool showcam=false;

            if(msg.buffer[cntr++] != 0xAC)return -1;
            if(msg.buffer[cntr++] != 0xA0)return -1;

            byte entire_status = msg.buffer[cntr++];
            if((entire_status & ENT_STTS_CAMERA)>0){
                showcam = true;
            }else{
                lbl_cam_btm.Text = "DISCONNECTED";
            }
            if((entire_status & ENT_STTS_WFACTIVE)>0){
                //printf("WiFi is active (connecting or reconnecting or disconnecting)\n");
                lbl_wf_btm.Text = "CONNECTING...";
            }else{
                //printf("WiFi is idle (connected or disconnected)\n");
                if((entire_status & ENT_STTS_WFCONN)>0){
                    //printf("WiFi is connected\n");
                    lbl_wf_btm.Text = "CONNECTED";
                }else{
                    //printf("WiFi is disconnected\n");
                    lbl_wf_btm.Text = "DISCONNECTED";
                }
            }

            char entire_mode = (char)msg.buffer[cntr++];
            switch(entire_mode){
                case 'i':
                    //printf("iXM mode (Phase one)\n");
                    lbl_mode_btm.Text = "iX LINK";
                break;
                case 'u':
                    //printf("USB mode\n");
                    lbl_mode_btm.Text = "USB";
                break;
                case 'w':
                    //printf("WiFi mode\n");
                    lbl_mode_btm.Text = "WiFi";
                break;
                case 'l':
                    //printf("LANC mode\n");
                    lbl_mode_btm.Text = "LANC";
                break;
                case 'b':
                    //printf("BlueTooth mode\n");
                    lbl_mode_btm.Text = "BLUETOOTH";
                break;
                case 'R':
                    //printf("RED mode\n");
                    lbl_mode_btm.Text = "RED";
                break;
                case 'L':
                    //printf("LAN mode\n");
                    lbl_mode_btm.Text = "LAN";
                break;
                case 'M':
                    //printf("Marshall mode\n");
                    lbl_mode_btm.Text = "MARSHALL";
                break;

            }


            char tagging_mode = (char)msg.buffer[cntr++];
            switch(tagging_mode){
                case 'n':
                    //printf("GeoTagging disabled\n");
                    lbl_gtg_btm.Text = "DISABLED";
                break;
                case 's':
                    //printf("GeoTagging is in SD card mode\n");
                    lbl_gtg_btm.Text = "Full TEXT";
                break;
                case 'c':
                    //printf("GeoTagging is in Direct EXIF mode\n");
                    lbl_gtg_btm.Text = "Direct EXIF";
                break;
                case 'p':
                    //printf("GeoTagging is in Direct EXIF mode\n");
                    lbl_gtg_btm.Text = "Event TEXT";
                break;
            }

            byte tagging_status = msg.buffer[cntr++];
            switch(tagging_status){
                case 0:
                    //printf("GeoTagging IDLE\n");
                    lbl_gtgsts_btm.Text = "IDLE";
                break;
                case 1:
                    //printf("Session Initialization\n");
                    lbl_gtgsts_btm.Text = "INITIALIZATION";
                break;
                case 2:
                    //printf("Session Running\n");
                    lbl_gtgsts_btm.Text = "RUN (" + sensed_photos+")";
                break;
                case 3:
                    //printf("Session Saving data\n");
                    lbl_gtgsts_btm.Text = "WRITE (" + gtg_progress + "%)";
                break;
                case 100:
                    //printf("Session Error\n");
                    lbl_gtgsts_btm.Text = "ERROR!";
                break;
            }

            byte autotriger_status = msg.buffer[cntr++];
            byte cam_featuresA = msg.buffer[cntr++];
            byte cam_featuresB = msg.buffer[cntr++];
            byte simpleupdatereserve1 = msg.buffer[cntr++];
            byte simpleupdatereserve2 = msg.buffer[cntr++];
            byte simpleupdatereserve3 = msg.buffer[cntr++];
            byte simpleupdatereserve4 = msg.buffer[cntr++];

/*
